const About = () => (
  <div className="max-w-2xl mx-auto mt-10 p-6 bg-white rounded shadow">
    <h2 className="text-2xl font-bold mb-4">About Quiz Maker</h2>
    <p>
      This is an online quiz platform for creating, sharing, and attempting
      quizzes.
    </p>
  </div>
);
export default About;
